#!/usr/bin/python
# ==============================================================================
# Author:   Tao Li (taoli@ucsd.edu)
# Date:     Jun 19, 2015
# Question: 130-Surrounded-Regions
# Link:     https://leetcode.com/problems/surrounded-regions/
# ==============================================================================
# Given a 2D board containing 'X' and 'O', capture all regions surrounded by 'X'.
# 
# A region is captured by flipping all 'O's into 'X's in that surrounded region.
# 
# For example,
# X X X X
# X O O X
# X X O X
# X O X X
# After running your function, the board should be:
# 
# X X X X
# X X X X
# X X X X
# X O X X
# ==============================================================================
# Method: Recusion
# Time Complexity: Exp
# Space Complexity: O(n^2)
# Note: ok but "RuntimeError: maximum recursion depth exceeded in cmp"
# ==============================================================================

class Solution:
    # @param {character[][]} board
    # @return {void} Do not return anything, modify board in-place instead.
    def solve(self, board):
        if not board or not board[0]:
            return

        m, n = len(board), len(board[0])
        visited = [[False]*n for _ in xrange(m)]
        
        for i in xrange(m):
            if board[i][0] == "O" and not visited[i][0]:
                self.search(visited, board, i, 0, m, n)
            if board[i][n-1] == "O" and not visited[i][n-1]:
                self.search(visited, board, i, n-1, m, n)

        for j in xrange(1,n-1):
            if board[0][j] == "O" and not visited[0][j]:
                self.search(visited, board, 0, j, m, n)
            if board[m-1][j] == "O" and not visited[m-1][j]:
                self.search(visited, board, m-1, j, m, n)

        for i in xrange(m):
            for j in xrange(n):
                if not visited[i][j]:
                    board[i][j] = "X"

    def search(self, visited, board, i, j, m, n):
        visited[i][j] = True
        if i-1 >= 0 and board[i-1][j] == "O" and not visited[i-1][j]:
            self.search(visited, board, i-1, j, m, n)
        if i+1 < m and board[i+1][j] == "O" and not visited[i+1][j]:
            self.search(visited, board, i+1, j, m, n)            
        if j-1 >= 0 and board[i][j-1] == "O" and not visited[i][j-1]:
            self.search(visited, board, i, j-1, m, n)
        if j+1 < n and board[i][j+1] == "O" and not visited[i][j+1]:
            self.search(visited, board, i, j+1, m, n)

